import React from "react";
import Tilt from 'react-tilt';
import './Logo.css';
import brain from './brain.png';

const Logo = () => {
    return (
        <div className='ma4 mt0'>
            <Tilt className="Tilt tc br2 shadow-1"
                  options={{max: 25}} style={{height: 150, width: 150}}>
                <div className="Tilt-inner">
                    <img alt='an image of a brain' src={brain}/>
                </div>
            </Tilt>
        </div>
    )
}

export default Logo;
